// Entrada
const data = items[0].json;

// Função utilitária para aplicar "N/A"
const na = v => {
  if (v === undefined || v === null) return "N/A";
  if (typeof v === "string" && v.trim() === "") return "N/A";
  if (Array.isArray(v)) {
    if (v.length === 0) return "N/A";
    if (v.every(item => typeof item === "object" && Object.keys(item).length === 0)) return "N/A";
  }
  if (typeof v === "object" && Object.keys(v).length === 0) return "N/A";
  return v;
};

// Arrays de peças
const pecas_cliente = na(data.pecas_cliente);
const pecas_ms = na(data.pecas_ms);

// ---- MÃO DE OBRA (AGORA CORRETA) ----
const mao = data.mao_de_obra || {};

let datas = [];
let totalEfetivo = 0;
let totalContingencial = 0;

// Suporta até 50 registros
for (let i = 1; i <= 50; i++) {
  const dataKey = `data${i}`;
  const efKey = `hh_efetivo${i}`;
  const ctKey = `hh_contingencial${i}`;

  if (mao[dataKey]) {
    datas.push(mao[dataKey]);
    totalEfetivo += Number(mao[efKey] || 0);
    totalContingencial += Number(mao[ctKey] || 0);
  }
}

// Ordena datas corretamente
datas.sort((a, b) => new Date(a) - new Date(b));

const primeiraData = na(datas[0]);
const ultimaData = na(datas[datas.length - 1]);

const totalEfetivoFinal = datas.length > 0 ? totalEfetivo : "N/A";
const totalContingencialFinal = datas.length > 0 ? totalContingencial : "N/A";
const totalGeralFinal =
  datas.length > 0 ? totalEfetivo + totalContingencial : "N/A";

// ---- RETORNO FINAL ----
return [
  {
    json: {
      pecas_cliente,
      pecas_medical_spin: pecas_ms,
      mao_de_obra: {
        primeiraData,
        ultimaData,
        totalEfetivo: totalEfetivoFinal,
        totalContingencial: totalContingencialFinal,
        totalGeral: totalGeralFinal
      }
    }
  }
];

